import styled from 'styled-components';
import ArticleImgBanner from './ArticleInnerBanner.png';

export const Banner = styled.section`
  background-image: url(${ArticleImgBanner});
  background-size: cover;
  background-position: center center;
  height: 20vh;
`

export const ArticleWrapper = styled.section`
  width: 50vw;
  margin: 0 auto;
`

export const ArticleTitle = styled.h2`
  background: #EBF2F1;
  margin-top: -35px;
  padding: 1rem 1.75rem;
  font-size: 2rem;
  border-radius: 5px;
  margin-bottom: 1rem;
`

export const ArticleSubTitle = styled.h3`
  padding: 0rem 1.75rem;
  color: #9E9EA7;
  font-weight: 400;
`

export const ArticleQuickLinks = styled.div`

`
